#!/usr/bin/eni python
# encoding: utf-8

from collections import defaultdict


class Solution(object):
    def increasingTriplet(self, nums):
        dp = defaultdict(list)
        n = len(nums)
        for j in range(n):
            for i in range(j+1):
                if i == j:
                    dp[(i, j)] = [[nums[i]]]
                else:
                    for seq in dp[(i, j-1)]:
                        if nums[j] > seq[-1]:
                            if len(seq) >= 2:
                                return True
                            dp[(i, j)].append(seq + [nums[j]])
                        else:
                            dp[(i, j)].append(seq)

                        if nums[i] < nums[j]:
                            dp[(i, j)].append([nums[i], nums[j]])

        for seqs in dp.values():
            if max(map(len, seqs) or [0]) >= 3:
                return True

        return False



